import React from 'react';
import '../Style/NavBar.css';

function NavBar() {
    return (
        <div className="NavBar"> 
            <a href="">Today</a>
            <a >Tomorrow</a>
            <a >10 Days</a>
        </div>
    )
}

export default NavBar
